import React from "react";
import { useState, useEffect } from "react";
import UsuarioIndividual from "../usuarioIndividual/UsuarioIndividual";
import axios from 'axios'
import "./UsuarioIndividual.css"

function ListaUsuarios(){

const url = `mongodb://${process.env.MONGODB_USER}:${process.env.MONGODB_PASSWORD}@${process.env.MONGODB_CLUSTER}.railway.app.6983/${process.env.MONGODB_DATABASE}?autoSource=admin`
const[datausuarios, setdatausuario] = useState([])

    useEffect(() => {
        axios.get(url).then(res => {
            console.log(res.data)
            setdatausuario(res.data)
        }).catch (err => {
        console.log(err)
        })
    }, [])

const listausuarios = datausuarios.map( usuario =>{
    return(
        <div> 
        <UsuarioIndividual usuario={usuario}/>
        </div>
        )
        })

    return(

    <div id="divdeusuarios">
        <h4 className="listitaUsuarios"> Lista de Usuarios </h4>
        <h3 id="espacio">espacio en bla</h3>
        {listausuarios}
    </div>
  )
}

export default ListaUsuarios
